script: |
  super -f text -I q709.spq | sort > q709.out

inputs:
  - name: q709.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab0 (FORMAT parquet) WHERE + + col0 + - col1 NOT BETWEEN col1 AND 65 + - col2 * + col2;
  - name: tab0

outputs:
  - name: q709.out
    data: |
      10
      47
      99
